
DROP DATABASE IF EXISTS kunstinder;

CREATE DATABASE kunstinder;
USE kunstinder;

CREATE TABLE user(id INT PRIMARY KEY AUTO_INCREMENT,
    vorname VARCHAR(45),
    nachname VARCHAR(45),
    plz VARCHAR(5),
    ort VARCHAR(45),
    strassehausnummer VARCHAR(45),
    username VARCHAR(45),
    passwort VARCHAR(45),
    rolle VARCHAR(45),
    status VARCHAR(45));

CREATE TABLE bewertung(id INT PRIMARY KEY AUTO_INCREMENT,
    bewertung SMALLINT, user_id INT, bild_id INT);

CREATE TABLE bild(id INT PRIMARY KEY AUTO_INCREMENT,
    bildtitel VARCHAR(45),
    erstelldatum DATE,
    bild BLOB,
    user_id INT);


CREATE TABLE kategorie(id INT PRIMARY KEY AUTO_INCREMENT,
    bezeichnung VARCHAR(45));

CREATE TABLE bild2kategorie(id INT PRIMARY KEY AUTO_INCREMENT, bild_id INT, kategorie_id INT);

ALTER TABLE bild2kategorie ADD FOREIGN KEY fk1_bild (bild_id) REFERENCES bild(id) ON DELETE CASCADE;
ALTER TABLE bild2kategorie ADD FOREIGN KEY fk2_kategorie(kategorie_id) REFERENCES kategorie(id) ON DELETE CASCADE ;

CREATE TABLE kommentar(id INT PRIMARY KEY AUTO_INCREMENT,
                       kommentartext VARCHAR(150),
                       erstelldatum DATETIME NOT NULL DEFAULT current_timestamp,
                       user_id INT,
                       bild_id INT);
# erstelldatum DATETIME NOT NULL DEFAULT current_timestamp -> Gib die zeit des Eintrags automatisch

ALTER TABLE kommentar ADD FOREIGN KEY fk3_user(user_id) REFERENCES user(id) ON DELETE CASCADE;
ALTER TABLE kommentar ADD FOREIGN KEY fk4_bild(bild_id) REFERENCES bild(id) ON DELETE CASCADE;

ALTER TABLE bewertung ADD FOREIGN KEY fk5_user(user_id) REFERENCES user(id) ON DELETE CASCADE;
ALTER TABLE bewertung ADD FOREIGN KEY fk6_bild(bild_id) REFERENCES bild(id) ON DELETE CASCADE;

ALTER TABLE bild ADD FOREIGN KEY fk7_user(user_id) REFERENCES user(id) ON DELETE CASCADE;


